import './TodayWeatherCard.scss'

function TodayWeatherCard(props) {
    const { temp, temp_max, temp_min, huminity, wind, city } = props.data
    return (
        <div className="TodayWeatherCard">
            <p>{city}</p>
            <p>{temp}</p>
            <p>
                L:{temp_min}
                H:{temp_max}
            </p>
            <p>huminity:{huminity}</p>
            <p>wind:{wind}</p>
        </div>
    );
}

export default TodayWeatherCard;
